from collections import deque
def a(n):
    reach, pq = {((1, 1), (1, 1))}, deque([((1, 1), (1, 1))])
    while len(pq) > 0:
        qa, qb = pq.pop()  # first tuple, qa, is player-to-move
        for i, j in [(0, 0), (0, 1), (1, 0), (1, 1)]:
            if qa[i] + qb[j] <= n:
                qn = (qb, tuple(sorted((qa[i] + qb[j], qa[1-i]))))
